import { ReactNode } from 'react';

import './CountryContainer.css';


interface IContainer {
    children: ReactNode;
    classes: string;
}

export function Container({ children, classes } : IContainer) {
    const divClasses = `container ${classes}`;
    return (
        <div className={divClasses}>
            {children}
        </div>
    );
}
